- input: "TEXT\x1CC00143743\x1C1\x1C\x1CF3XN\x1CLine 21b reports reimbursements for
    travel expenses which are not itemized because they do not exceed the 200 dollar
    itemization level and do not exceed the 200 dollar aggregate per vendor amount.
    \ With respect to the expenditures made by the Party for payroll, payroll taxes,
    and other payroll or employee benefit-related expenses, the Party adheres to 11
    CFR 300.33, and also follows the Commissions revision of the rules as adopted
    on December 1, 2005. Specifically, the Party pays for these costs with 100 percent
    federal funds when the employee spends more than 25 percent of his or her time
    in a month on federal election activity FEA or activity in connection with a federal
    election. These expenditures are reported on Schedule B for Line 30b.  Alternatively,
    when an employee does not meet the 25 percent threshold, the Party allocates these
    costs as an overhead/administrative expense, and reports these disbursements on
    a Schedule H4 for Line 21a.  Transfers from federal to non-federal accounts were
    made for cash flow purposes unless otherwise disclosed. These funds do not represent
    a reimbursement of funds to the non-federal account for disbursements made to
    influence the election or defeat of federal candidates.  The Republican Party
    of Texas uses a tickler system to track transfers of non-federal funds for allocated
    administrative expenditures to comply with 11 CFR 106.6(e)(2) and 106.7(f)(2)
    of the election code, in making timely transfers no more than 10 days before or
    60 days after the payment to vendors of federal funds.  \n"
